import React from "react";


const Home = () => {
    return (
        <div className="home">
          <div className="card home-card">
            <h5>hinata</h5>
            <div className="card-image">
                <img src="https://img.freepik.com/free-photo/field-covered-greenery-surrounded-by-zebras-sunlight-blue-sky_181624-18150.jpg?uid=R147514784&ga=GA1.1.1158692380.1730345942&semt=ais_hybrid" />
            </div>
            <div className="card-content">
                <h6>title</h6>
                <p>this is amazing post</p>
                
            </div>
           </div>
        </div>
    )
}

export default Home;
